import React from "react";

export default class Cursor extends React.Component {
  render() {
    return (
      <div
        style={{
          position: "absolute",
          left: this.props.cursorPos.x - 200,
          top: this.props.cursorPos.y - 150,
          width: 30,
          height: 30,
          zIndex: 100,
          borderRadius: "50%",
          background: this.props.color
        }}
      >
        {" "}
        {this.props.x} {this.props.y}{" "}
      </div>
    );
  }
}
